script: |
  super -f text -I q11311.spq | sort > q11311.out

inputs:
  - name: q11311.spq
    data: |
      SELECT + 75 + + + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + col0 NOT BETWEEN + - col2 AND - col1 - col0 - col1;
  - name: tab2

outputs:
  - name: q11311.out
    data: |
      121
      139
      150
